  false,\n\t\"url\": null,\n\t\"notes\": \"This data represents all of the Countyu2019s
  residential real estate properties and all of the associated tax charges and credits
  with that property processed at the annual billing in July of each year, excluding
  any subsequent billing additions and/or revisions throughout the year.  This dataset
  excludes the names of the property owners.  The addresses in this database represent
  the address of the property.  For more information about the individual taxes and
  credits, please go to http://www.montgomerycountymd.gov/finance/taxes/faqs.html#credit.
